        <div class="header">

                <button class="exchange-button" onclick="changeColor(this)">MCX</button>
            </div>

        <div class="form">
            <div class="input-group">
                <label for="symbol">Symbol</label>
                <select id="symbol" onchange="updateExpiryAndStrike()"></select>
            </div>
            <div class="input-group">
                <label for="product">Product</label>
                <select id="product" onchange="updateSymbols()">

                    <option value="OPTION">OPTION</option>

            </div>
            <div class="input-group">

                <select id="expiry"></select>
            </div>
            <div class="input-group">
                <label for="optionType">Option Type</label>

                    <option value="CALL">CALL</option>
                    <option value="PUT">PUT</option>
                </select>
            </div>
            <div class="input-group">
                <label for="strikePrice">Strike Price</label>
                <select id="strikePrice"></select>
            </div>
            <div class="input-group">
                <label>Buy / Sell</label>
                <div class="buy-sell-buttons">

                    <input type="radio" name="buy-sell" id="sellRadio">
                    <label for="sellRadio">Sell</label>
                </div>
            </div>
            <div class="input-group">
                <label for="lots">Lots</label>
                <input type="number" id="lots" value="0">
            </div>
            <div class="input-group">
                <label for="Quantity">Quantity</label>
                <select id="Quantity"></select>
            </div>        
            <div class="buttons2">
                <button class="buttons2 addbutton">Add</button>
                <button class="buttons2 resetbutton">Reset</button>
            </div>

        </div>

        
        <div class="margin-requirements">

                function changeColor(button) {
        // Function to handle the color change of the selected exchange button
        var buttons = document.getElementsByClassName("exchange-button");
        for (var i = 0; i < buttons.length; i++) {
            buttons[i].classList.remove("neon");
        }
        button.classList.add("neon");
    }

    function updateSymbols() {
        // Function to update the symbols dropdown based on the product selection
        var product = document.getElementById("product").value;
        var symbolDropdown = document.getElementById("symbol");
        symbolDropdown.innerHTML = "";

        // Load the appropriate dataset based on the product selection
        var data = (product === "FUTURE") ? dataForFutures : dataForOptions;
        var lines = data.split('\n');

        // Determine whether to disable the "CALL" and "PUT" options based on the product selection
        var disableCallPut = product === "FUTURE";

        // Parse the CSV data and populate the symbols dropdown
        for (var i = 1; i < lines.length; i++) {
            var cells = lines[i].split(',');
            var symbol = cells[0];
            var optionType = (product === "FUTURE") ? "FUTURE" : cells[3];
            var expiry = cells[1];
            var strikePrice = cells[2];
            var quantity = cells[4];
            var optionValue = (product === "FUTURE") ? symbol : `${symbol} ${expiry} ${optionType} ${strikePrice} (Qty: ${quantity})`;
            var optionElement = document.createElement("option");
            optionElement.value = optionValue;
            optionElement.textContent = optionValue;
            symbolDropdown.appendChild(optionElement);
        }

                // Enable/disable "CALL" and "PUT" options based on the product selection
            var optionTypeDropdown = document.getElementById("optionType");
            var callOption = optionTypeDropdown.querySelector('option[value="CALL"]');
            var putOption = optionTypeDropdown.querySelector('option[value="PUT"]');
            callOption.disabled = disableCallPut;
            putOption.disabled = disableCallPut;


        // Update the expiry and strike price dropdowns
        updateExpiryAndStrike();
    }

    function updateExpiryAndStrike() {
        // Function to update the expiry and strike price dropdowns based on the selected symbol
        var product = document.getElementById("product").value;
        var symbolDropdown = document.getElementById("symbol");
        var selectedOption = symbolDropdown.value;
        var expiryDropdown = document.getElementById("expiry");
        var strikePriceDropdown = document.getElementById("strikePrice");
        var quantityDropdown = document.getElementById("Quantity");

        // Clear existing options in the dropdowns
        expiryDropdown.innerHTML = "";
        strikePriceDropdown.innerHTML = "";
        quantityDropdown.innerHTML = "";

        // Parse the selected option value and populate the expiry, strike price, and quantity dropdowns
        var parts = selectedOption.split(' ');
        var symbol = parts[0];
        var expiry = parts[1];
        var optionType = (parts.length === 6) ? parts[2] : "";
        var strikePrice = (parts.length === 6) ? parts[3] : "";
        var quantity = (parts.length === 6) ? parts[5].slice(5, -1) : "";

        var data = (product === "FUTURE") ? dataForFutures : dataForOptions;
        var lines = data.split('\n');

        for (var i = 1; i < lines.length; i++) {
            var cells = lines[i].split(',');
            if (cells[0] === symbol) {
                var expiryValue = cells[1];
                var strikePriceValue = cells[2];
                var lotSize = parseInt(cells[3], 10);

                var expiryOption = document.createElement("option");
                expiryOption.value = expiryValue;
                expiryOption.textContent = expiryValue;
                expiryDropdown.appendChild(expiryOption);

                var strikePriceOption = document.createElement("option");
                strikePriceOption.value = strikePriceValue;
                strikePriceOption.textContent = strikePriceValue;
                strikePriceDropdown.appendChild(strikePriceOption);

                // Populate the quantity dropdown with the quantity value
                var quantityOption = document.createElement("option");
                quantityOption.value = quantity;
                quantityOption.textContent = quantity;
                quantityDropdown.appendChild(quantityOption);
            }
        }
        
    }
